import { Container, Row, Col, Placeholder } from 'react-bootstrap';
import { Icon } from '@iconify/react';
import Image from 'react-bootstrap/Image';
import halfbyte from "../works/halfbyte.png";
import upcancer from "../works/upcancer.png";
// import likeex from "../works/likeex.png";

export default function Work() {
    return (
        <Container className=''>
            <Row className="justify-content-md-center">
                <Col>
                    <Image src={upcancer} className="d-block float-start"></Image>
                </Col>
                <Col>
                    <Image src={upcancer} className="d-block float-center"></Image>
                </Col>
                <Col>
                <Image src={upcancer} className="float-end"></Image>
                    {/* <Image src={halfbyte} className="d-block rounded float-end"></Image> */}
                </Col>
            </Row>


        </Container>
    )
}
